import { React } from "react";
import { css } from '@emotion/css'
import { MoreHorizontal } from 'react-feather'
import Chip from './Chip'



function Card() {
    return (
        <div className={css`min-width: 290px; max-height: 100%; display:flex; flex-direction:column; gap:20px`}>
            <div className={css`  display: flex; align-items: flex-start;`}>
                <div className={css` flex: 3; display: flex; flex-wrap: wrap; gap: 5px; font-size: 14px; line-height: 21px;`}>
                    <Chip text="SEO" color="red" />
                </div>
                <MoreHorizontal />
            </div>
            <div className={css`flex: 1;font-weight: bold; font-size: 1rem; line-height: 1.875rem;`}>Titulo</div>
            <div className={css`display: flex; justify-content: space-between; align-items: center;`}></div>
        </div>
    )
}

export default Card;
